    <div className="App">
    <ChatEngine
      height="100vh"
      projectID="dd38e632-4942-4a42-80b4-98b1329b0d84"
      userName="suwandiaminsangaji"
      userSecret="wandy123"
      renderChatFeed = { (chatAppProps) => <ChatFeed {...chatAppProps} /> }
      onNewMessage = { () => new Audio('https://chat-engine-assets.s3.amazoneaws.com/click.mp3').play()}
    />
    </div>
  );
}

export default App;

